from math import factorial
def afind(limit, startk=1):
    k = startk; kkprev = (k-1)**2; f = factorial(k-1)
    while k < limit:
        kk = k*k
        if kkprev < f%kk: print(k, end=", ")
        kkprev = kk; f *= k; k += 1
